INSERT INTO `phimcongchieu` (`id_phim`, `ten_phim`, `daodien_phim`, `namsx_phim`, `nuocsx_phim`, `ghichu`, `img`) VALUES
(1, 'Mắt biếc', 'Victor Vũ', '2019', 'Việt Nam', 'Mắt Biếc kể ta nghe câu chuyện đời của Ngạn và Hà Lan, đôi bạn lớn lên cùng nhau ở làng Đo Đo, cùng qua tuổi thơ và bên nhau lúc thiếu thời, đến khi trưởng thành vẫn chẳng dứt duyên được. Ngạn là một chàng trai thôn quê trầm tính, si mê Hà Lan với đôi mắt biếc đượm đầy những trong veo và nét buồn thơ mộng. Vì Hà Lan, Ngạn thành thi sĩ, thành ca sĩ, thành vệ sĩ luôn ở bên những lúc cô cần. Nhưng đáng tiếc Hà Lan lại không cưỡng được những xa hoa chốn thị thành nên rơi vào bẫy tình với một gã sở khanh và bị phản bội, cho đến tận lúc ấy, tình yêu của Ngạn dành cho cô vẫn không chút suy suyển.', );
INSERT INTO `phimcongchieu` (`id_phim`, `ten_phim`, `daodien_phim`, `namsx_phim`, `nuocsx_phim`, `ghichu`, `img`) VALUES
(2, 'Ròm', 'Trần Thanh Huy', '2020', 'Việt Nam', 'Tác phẩm đưa khán giả đến một khu chung cư cũ, sắp bị giải tỏa ở TP.HCM. Tại đây, nhiều người dân muốn đổi đời bằng cách chơi đề. Mỗi buổi chiều, họ hồi hộp trông chờ những con số may mắn, gửi vào đó ước mơ về một tương lai xán lạn hơn.\r\nRòm là cậu bé bụi đời làm “cò đề”, chuyên tư vấn số và giúp mọi người ghi đề. Để kiếm miếng ăn qua ngày, cậu vừa cạnh tranh với những cậu bé cùng nghề, vừa phải xoay xở giữa đám giang hồ cùng những người dân hăng máu đỏ đen.', );
INSERT INTO `phimcongchieu` (`id_phim`, `ten_phim`, `daodien_phim`, `namsx_phim`, `nuocsx_phim`, `ghichu`, `img`) VALUES
(3, 'Tiệc trăng máu', 'Nguyễn Quang Dũng', '2020', 'Việt Nam', 'Tiệc Trăng Máu là bộ phim xoay quanh một bữa tiệc “đẫm máu” của nhóm bạn chơi thân 40 năm với nhau. Bữa tiệc tân gia diễn ra vui vẻ cho tới khi Nguyệt Ánh (Hồng Ánh đóng) đề nghị tất cả chơi một trò chơi công khai những tin nhắn và điện thoại gọi tới. Và rồi hàng loạt bí mật dần hé lộ, cả 4 gia đình và cả nhóm bạn đều có những bí mật động trời, cho tới khi lộ ra họ đã không còn giữ được trọn vẹn một mối quan hệ nào cả.', );
INSERT INTO `phimcongchieu` (`id_phim`, `ten_phim`, `daodien_phim`, `namsx_phim`, `nuocsx_phim`, `ghichu`, `img`) VALUES
(4, 'Hai Phượng', 'Ngô Thanh Vân', '2019', 'Việt Nam', 'Bộ phim là hành trình nghẹt thở và căng thẳng của bà mẹ đơn thân Hai Phượng (Ngô Thanh Vân) khi phải đối đầu với cả 1 đường dây tội phạm bắt cóc và buôn bán nội tạng xuyên quốc gia để cứu đứa con gái bé bỏng Mai (Mai Cát Vi). Để cứu được con, Hai Phượng chỉ có 14 tiếng đồng hồ rượt đuổi từ Cần Thơ, Sài Gòn cho đến Phan Thiết, và phải đối đầu với rất nhiều giang hồ cộm cán, sẵn sàng tiêu diệt ai dám cản đường chúng. Hành trình cứu con của Hai Phượng càng trở nên gian nan và khó khăn hơn khi bất kỳ một sơ xuất nhỏ nào cũng sẽ phải trả giá bằng chính mạng sống của chính cô và bé Mai.', );

